import Axios from "axios";
import React, { useEffect, useState } from "react";

interface User {
  id: number;
  name: string;
  scheduled_to: string;
}

function AdminPage() {
  const [users, setUsers] = useState<User[]>([
    {
      id: 0,
      name: "",
      scheduled_to: "",
    },
  ]);

  async function getUsers() {
    setUsers(await Axios.get("http://localhost:3003/culto"));
  }

  useEffect(() => {
    getUsers();
    const signedUsers = users.map((user) => (
      <li key={user.id}>{user.data.name}</li>
    ));
  });

  return (
    <div id="admin-page">
      <div className="content-wrapper">
        <ul>
          <li>Teste</li>
          <li>Teste</li>
          <li>Teste</li>
          <li>Teste</li>
          {/* {users} */}
        </ul>
      </div>
    </div>
  );
}

export default AdminPage;
